const Filteredchip = () => {
  // function to delete chips
  function hide() {
    document.getElementById("single-filter-elem").style.display = "none";
  }
  return (
    <>
      <div id="filtered-elements" className="flex overflow-scroll no-scrollbar">
        <div
          id="single-filter-elem"
          className="flex border-2 border-black shadow-custom rounded m-1 p-1 bg-my-pink transition-al"
        >
          <div>
            <p className="font-bold">Management</p>
          </div>
          <div
            className="px-2 font-bold text-gray-700 hover:text-black hover:cursor-pointer"
            onClick={hide}
          >
            X
          </div>
        </div>
      </div>
    </>
  );
};

export default Filteredchip;
